Various generic APIs in Rust often return references to data (&T). When T is a small Copy type like i32, you end up with &i32 while many API expect i32, so dereference has to happen somewhere . Prefer dereferencing as early as possible, typically in a pattern: // GOOD
fn compute(map: HashMap<&'str, i32>) { if let Some(&value) = map.get("key") { process(value) }
}
fn process(value: i32) { ... } // BAD
fn compute(map: HashMap<&'str, i32>) { if let Some(value) = map.get("key") { process(*value) }
}
fn process(value: i32) { ... } Rationale: if the value is used multiple times, dereferencing in the pattern saves keystrokes. If the value is used exactly once, we just want to be consistent. Additional benefit of early deref is reduced scope of borrow. Note that for some big Copy types, notably CryptoHash, we sometimes use references for performance reasons. As a rule of thumb, T is considered big if size_of::<T>() > 2 * size_of::<usize>().

