To make protocol upgrades more robust, we introduce the concept of nightly protocol version together with the protocol feature flags to allow easy testing of the cutting-edge protocol changes without jeopardizing the stability of the codebase overall. In Cargo.toml file of the crates we have in nearcore, we introduce rust compile-time features nightly_protocol and nightly nightly_protocol = []
nightly = [ "nightly_protocol", ...
] where nightly_protocol is a marker feature that indicates that we are on nightly protocol whereas nightly is a collection of new protocol features which also implies nightly_protocol. For example, when we introduce EVM as a new protocol change, suppose the current protocol version is 40, then we would do the following change in Cargo.toml: nightly_protocol = []
nightly = [ "nightly_protocol", "protocol_features_evm", ...
] In core/primitives/src/version.rs , we would change the protocol version by: #[cfg(feature = “nightly_protocol”)]
pub const PROTOCOL_VERSION: u32 = 100;
#[cfg(not(feature = “nightly_protocol”)]
pub const PROTOCOL_VERSION: u32 = 40; This way the stable versions remain unaffected after the change. Note that nightly protocol version intentionally starts at a much higher number to make the distinction between stable protocol and nightly protocol more clear. To determine whether a protocol feature is enabled, we do the following: We maintain a ProtocolFeature enum where each variant corresponds to some protocol feature. For nightly protocol features, the variant is gated by the corresponding rust compile-time feature. We implement a function protocol_version to return, for each variant, the corresponding protocol version in which the feature is enabled. When we need to decide whether to use the new feature based on the protocol version of the current network, we can simply compare it to the protocol version of the feature. To make this simpler, we also introduced a macro checked_feature For more details, please refer to core/primitives/src/version.rs .

