Borsh is our custom serializer ( link ), that we use mostly for things that have to be hashed. The main feature of Borsh is that, there are no two binary representations that deserialize into the same object. You can read more on how Borsh serializes the data, by looking at the Specification tab on borsh.io . The biggest pitfall/risk of Borsh, is that any change to the structure, might cause previous data to no longer be parseable. For example, inserting a new enum ‘in the middle’: pub enum MyCar { Bmw, Ford,
} If we change our enum to this: pub enum MyCar { Bmw, Citroen, Ford, // !! WRONG - Ford objects cannot be deserialized anymore
} This is especially tricky if we have conditional compilation: pub enum MyCar { Bmw, #[cfg(feature = "french_cars")] Citroen, Ford,
} Is such a scenario - some of the objects created by binaries with this feature enabled, will not be parseable by binaries without this feature. Removing and adding fields to structures is also dangerous. Basically - the only ‘safe’ thing that you can do with Borsh - is add a new Enum value at the end.

